import React from 'react';

const Index = () => {
    return (
        <div className="flex flex-wrap items-center justify-center">
            <div className="flex flex-row px-4 py-4">
                <img src="/img/pfp.png" className="rounded-full animate-bounces"></img>
            </div>
        </div>
    )
}

export default Index;
